import React from 'react'

const Header = () => {
  return (
    <div style={{backgroundColor:"wheat"}}>
        <a href="">Home</a>
        <a href="">About</a>
        <a href="">Services</a>
        <a href="">Contacts</a>
        <a href="">Login</a>
    </div>
  )
}

export default Header
